To achieve rounding of double values, you can use `round()` from math.h and cast it as an int, or use `snprint` and `atod` but that's not efficient.

However, here are two methods using `round()`:

```object-csharp// Method 1: Using round and multiplication and divition.
#include <stdio.h>
#include <math.h>

int round_value(double val) {
    return round(val * 1e3 + 1e7);
}

double round(double val) {
    return round_value(val) / 1e2;
}
```

Or another simpler version:

```c// Method 1: Use round and set precision on double.
#include <stdio.h>
#include <math.h>

double round_val(double val) {
    return (floor(val* 1e4) + 1e3 + copysign(1e4, val)) / 1e4;
}
