**Fizz Buzz Implementation**
=========================

### C++ Implementation
````cpp
// fizzbuz.cpp

/**
 * Plays fizz-bazz from 1-n
 *
 * Parameters: 
 *     int - The max value of fizz-bazz
 */
void play_fizz_buzz(int limit) {
    // Iterate over each number between 1 and the given limit
    while (limit > 0) {
        if (!(limit%5)) {
            std::cout << "Buzz";
            // Print fizz only when not multiple both multiple
            // since buzz comes after fizz
            if (!(limit %5)) {
                std::cout << ", ";
            }
        }

        if (!(limit%3)) {
           std::cout << "Buzz, ";
        } else {
           std::cout << limit;
        }
        std::cout << "\n";

        --limit;
   }
}

int main() {
    play_fizz_buzz(100);
}
````
